let loglevel = "info"

class Logger {
    constructor() {
        let available_loglevels = {
            "debug": 0,
            "info": 1,
            "exception": 2,
            "none": 3
        }
        if(loglevel in available_loglevels) {
            this.loglevel = available_loglevels[loglevel]
        } else {
            this.loglevel = available_loglevels["exception"]
        }
    }

    logPropertyChange(property, event, value) {
        if(this.loglevel < 2) {
            console.log(`event '${event}' on property '${property}' of <${this.constructor.name}> with value`, String(value))
        }
    }

    logInit(initial_values) {
        if(this.loglevel < 2 ) {
            console.log(`initializing object of type <${this.constructor.name}>`)
            if(this.loglevel == 0) {
                console.log(initial_values)
            }
        }
    }

    logException(property, error) {
        if(this.loglevel < 3) {
            console.log(`exception occurred for property '${property}' in <${this.constructor.name}>: "`, error.message, '"')
            console.log(error.stack)
        }
        throw error
    }
}

class StateMachine extends Logger {
    constructor(name) {
        super()
        if(!name instanceof String) {
            let e = new TypeError("name bust be a string")
            this.logException("name", e)
        }

        this.name = name
        this.states = []
        this.locked = false

        this.logInit({
            name: this.name,
            states: this.states,
            start: this.start,
            locked: this.locked
        })
    }

    lock() {
        this.locked = true
    }

    unlock() {
        this.locked = false
    }

    setStartState(start) {
        if(this.locked) {
            let e = Error("the machine is locked")
            this.logException("start", e)
        }

        if(!start instanceof State) {
            let e = TypeError("start must be an instance of State")
            this.logException("start", e)
        }

        this.logPropertyChange("start", "set", start)
        this.start = start
    }

    addState(state) {
        if(this.locked) {
            let e = Error("the machine is locked")
            this.logException("states", e)
        }

        if(!state instanceof State) {
            let e = TypeError("state must be an instance of State")
            this.logException("states", e)
        }

        state.setMachine(this)
        this.logPropertyChange("states", "push", state)
        this.states.push(state)
    }

    toString() {
        return "<StateMachine>"
    }
}

class State extends Logger {
    constructor(name) {
        super()
        if(!name instanceof String) {
            let e = TypeError("name must be a string")
            this.logException("name", e)
        }

        this.name = name
        this.transitions_in = []
        this.transitions_out = []
        this.locked = false

        this.logInit({
            name: this.name,
            transitions_in: this.transitions_in,
            transitions_out: this.transitions_out,
            locked: this.locked
        })
    }

    lock() {
        this.locked = true
    }

    unlock() {
        this.locked = false
    }

    setMachine(machine) {
        if(this.locked) {
            let e = Error("the state is locked")
            this.logException("machine", e)
        }

        if(!machine instanceof StateMachine) {
            let e = new TypeError("machine must be an instance of StateMachine")
            this.logException("machine", e)
        }

        this.logPropertyChange("machine", "set", machine)
        this.machine = machine
    }

    addTransitionIn(transition) {
        if(this.locked) {
            let e = Error("the state is locked")
            this.logException("transitions_in", e)
        }

        if(!transition instanceof Transition) {
            let e = new TypeError("transition bust be an instance of Transition")
            this.logException("transitions_in", e)
        }

        transition.setTo(this)
        this.logPropertyChange("transitions_in", "push", transition)
        this.transitions_in.push(transition)
    }

    addTransitionOut(transition) {
        if(this.locked) {
            let e = Error("the state is locked")
            this.logException("transitions_out", e)
        }

        if(!transition instanceof Transition) {
            let e = new TypeError("transition must be an instance of Transition")
            this.logException("transitions_out", e)
        }

        transition.setFrom(this)
        this.logPropertyChange("transitions_out", "push", transition)
        this.transitions_out.push(transition)
    }

    toString() {
        return "<State>"
    }
}

class Transition extends Logger {
    constructor(events) {
        super()
        if(!events instanceof Array) {
            let e = new TypeError("events must be an instance of Array")
            this.logException("events", e)
        }

        for(let event in events) {
            if(!event instanceof String) {
                let e = new TypeError("events must be an array of strings")
                this.logException("transitions_out", e)
            }
        }

        this.events = events
        this.locked = false

        this.logInit({
            events: this.events,
            locked: this.locked
        })
    }

    lock() {
        this.locked = true
    }

    unlock() {
        this.locked = false
    }

    setFrom(state) {
        if(this.locked) {
            let e = Error("the transition is locked")
            this.logException("from", e)
        }

        if(!state instanceof State) {
            let e = new TypeError("state must be an instance of State")
            this.logException("from", e)
        }

        this.logPropertyChange("from", "set", state)
        this.from = state
    }

    setTo(state) {
        if(this.locked) {
            let e = Error("the transition is locked")
            this.logException("to", e)
        }

        if(!state instanceof State) {
            let e = new TypeError("state must be an instance of State")
            this.logException("to", e)
        }

        this.logPropertyChange("to", "set", state)
        this.to = state
    }

    toString() {
        return "<Transition>"
    }
}

function makeDoors() {
    let doors = new StateMachine("doors")

    let stateOpened = new State("opened")
    let stateClosed = new State("closed")
    let stateLocked = new State("locked")

    doors.setStartState(stateClosed)
    doors.addState(stateClosed)
    doors.addState(stateOpened)
    doors.addState(stateLocked)

    let transOpen = new Transition(["open"])
    let transClose = new Transition(["close"])
    let transLock = new Transition(["lock"])
    let transUnlock = new Transition(["unlock"])

    stateOpened.addTransitionIn(transOpen)
    stateOpened.addTransitionOut(transClose)

    stateClosed.addTransitionIn(transClose)
    stateClosed.addTransitionIn(transUnlock)
    stateClosed.addTransitionOut(transOpen)
    stateClosed.addTransitionOut(transLock)

    stateLocked.addTransitionIn(transLock)
    stateLocked.addTransitionOut(transUnlock)

    return doors
}

function execute(machine, events) {
    let errorCnt = 0
    let executionLog = []

    events.map((event) => {
        let transition = machine.start.transitions_out.map((transition) => {
            return {
                success: transition.events.includes(event),
                from: transition.from,
                to: transition.to
            }
        }).reduce((acc, item) => {
            return item.success ? item : acc
        }, {success: false, from: machine.start})
        if(transition.success) {
            try {
                machine.setStartState(transition.to)
                executionLog.push("Executed transition from "+transition.from.name+" to "+transition.to.name+" with event "+event)
            } catch(e) {
                errorCnt++
                executionLog.push("An exception occurred while executing transition from "+transition.from.name+" to "+transition.to.name+" with event "+event)
            }
        } else {
            errorCnt++
            executionLog.push("State "+transition.from.name+" has no outgoing transitions with event "+event)
        }
    })
    return {
        errorCnt,
        executionLog: executionLog.join("\n")
    }
}

